  }
  const values=['val1','val2','val3']
  return (
    <div className="App">
      <Button name="hello"  variant='primary' color='white' clickHandler={helloHandler}/>
      <Dropdown values={values} width={``}></Dropdown>
    </div>
  );
}

export default App;
